import React from "react";
// import { Link } from "react-router-dom";
import { useSelector } from "react-redux";

const ProductComponent = () => {

  const users = useSelector((state) => state.allProducts.users);
  const renderList = users.map((user) => {
    const { id, email, first_name, last_name, avatar } = user;
    console.log(users)
    return (
      <div className="four wide column" key={id}>

          <div className="ui link cards">
            <div className="card">
              <div className="image">
                <img src={avatar} alt={id} />
              </div>
              <div className="content">
                <div className="header">{first_name}{ last_name}</div>
                <div className="meta price">@ {email}</div>
                <div className="meta">{id}</div>
              </div>
            </div>
          </div>

      </div>
    );
  });
  return <>{renderList}</>;
};

export default ProductComponent;
